import { Link } from "react-router-dom";
import ImageIcon from "../icons/ImageIcon";
import { HeaderContainer, Icon, Links } from "./styles";


const Header = () => {
  return (
    <HeaderContainer>
      <Icon><ImageIcon /></Icon>
      <Links>
        <LinkItem href="/projects">project</LinkItem>
        <LinkItem href="/thoughts">thoughts</LinkItem>
      </Links>
    </HeaderContainer>
  );
};

export default Header;
